import React, { useEffect} from "react"
import TattooCard from "../../TattooCard/TattooCard"
import "./Home.css"
import { useAppSelector } from "../../../app/hooks"
import { userSelector } from "../../../features/user/userSlice"
import { useDispatch, useSelector } from "react-redux"
import { getAllImages } from "../../../features/images/imagesAction"
import TattooWrapper from "../../TattooCard/TattooWrapper"
import { AppDispatch } from "../../../app/store";

const Home = () => {
    const dispatch = useDispatch<AppDispatch>();
//     const user = useAppSelector(userSelector)
//     const userImages = useSelector((state: any)=> state.images)

//    console.log(userImages)

useEffect(() => {
    dispatch(getAllImages())

  }, []);

    return(
        <div className="search">
            <input className="searchInput" type="text"  placeholder="Search for tattoo ideas.."></input>
            <button className="searchButton">Search</button>
            <TattooWrapper />
            </div>
    )
}

export default Home
